import React from "react";
import styled from "styled-components";

const SixthPage = () => {
  return (
    <Container>
      <Wrap>
        <img src="/images/model-s/powertrain.jpg" alt="" />
      </Wrap>
    </Container>
  );
};

const Container = styled.div`
  height: 150vh;
  background: rgb(240, 240, 240);
`;
export default SixthPage;
